# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - http.server.BaseHTTPRequestHandler~Subclass
    - requests_auth
    - Member[oauth2_authentication_responses_server].Member[BaseHTTPRequestHandler]
  - - http.server.BaseHTTPRequestHandler~Subclass
    - requests_auth
    - Member[oauth2_authentication_responses_server].Member[OAuth2ResponseHandler]
  - - requests.models.Response~Subclass
    - requests_auth
    - Member[errors].Member[Response]
  - - requests.models.Response~Subclass
    - requests_auth
    - Member[oauth2_authentication_responses_server].Member[Response]
  - - requests.models.Response~Subclass
    - requests_auth
    - Member[oauth2_tokens].Member[Response]
